// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;
import "@openzeppelin/contracts/access/Ownable.sol";

contract BridgeState is Ownable {
    uint32 public index;

    event LogAddToken(address tokenAddress);
    event LogRemoveToken(address tokenAddress);

    mapping(address => bool) public _soldierKeys;
    // List of valid tokens we accept
    mapping(address => bool) public _validTokens;

    constructor() {
        index = 0;
    }

    function addToken(address _address) public onlyOwner returns (bool) {
        _validTokens[_address] = true;
        emit LogAddToken(_address);
        return true;
    }

    function removeToken(address _address) public onlyOwner returns (bool) {
        delete _validTokens[_address];
        emit LogRemoveToken(_address);
        return true;
    }

    function addSoldier(address soldierAdd) public onlyOwner returns (bool) {
        _soldierKeys[soldierAdd] = true;
        index++;
        return true;
    }

    function removeSoldier(address soldierAdd) public onlyOwner returns (bool) {
        delete _soldierKeys[soldierAdd];
        index--;
        return true;
    }

    function getNumOfSoldiers() public view returns (uint256) {
        return index;
    }

    function isSoldier(address _msgSender) public view returns (bool) {
        return (_soldierKeys[_msgSender]);
    }

    function isTokenValid(address _address) public view returns (bool) {
        return _validTokens[_address];
    }
}
